import React from 'react'
import "./stylesheets/App.css"
import Home from "./Containers/Home";
import About from "./Containers/About";
import Portfolio from "./Containers/Portfolio";

import { Element } from 'react-scroll'
import Navbar from "./Containers/Navbar";
import Blog from "./Containers/Blog";
import Contact from "./Containers/Contact";
import ScrollTrigger from 'react-scroll-trigger';


class App extends React.Component {

    state = {
        current_page: ''
    }

    componentDidMount() {
        this.setState({
            current_page: "home"
        })
    }

    changePage = (page) => {
        this.setState({
            current_page: page
        })
    }


    render() {
        return (
            <div id="app-wrapper">
                {this.state.current_page === "home" ? null : <Navbar
                    changePage={this.changePage} currentPage={this.state.current_page}/>}
                <Element name="home" id="home-wrapper">
                    <ScrollTrigger
                        onEnter={this.setState({current_page: "home"})}
                        onExit={this.setState({current_page: "about"})}>
                        <Home changePage={this.changePage} />
                    </ScrollTrigger>

                </Element>
                <Element name="about">
                    <About changePage={this.changePage} />
                </Element>
                <Element name="portfolio">
                    <Portfolio changePage={this.changePage} />
                </Element>
                <Element name="blog">
                    <Blog changePage={this.changePage} />
                </Element>
                <Element name="contact">
                    <Contact changePage={this.changePage} />
                </Element>
            </div>
        );
    }

}

export default App
